import home from './fonts/home.svg';
import gear from './fonts/gear.svg';
import homeBeat from './fonts/home_beat.svg';
import './Header.css'

function Home() {
	return (
		<div className='Home'>
			<a href="index.html"><img src={home} className="Home-logo" alt={homeBeat} /> </a>
			<img src={gear} className="Gear" alt="" />
		</div>
	);
}
export default Home;

